import React from 'react';
import { View } from 'react-native';
import LinearGradient from 'react-native-linear-gradient';

const MyView = ({ gradient }) => {
    return (
      <View style={{
        flex: 1,
        backgroundColor: 'transparent',
        backgroundImage: 'linear-gradient(90deg, rgba(190,228,228,1) 0%, rgba(190,228,228,1) 10%, rgba(242,204,201,1) 10%, rgba(242,204,201,1) 20%, rgba(235,222,240,1) 20%, rgba(235,222,240,1) 30%, rgba(239,196,167,1) 30%, rgba(239,196,167,1) 30%, rgba(239,196,167,1) 40%, rgba(190,228,228,1) 40%, rgba(190,228,228,1) 50%, rgba(242,204,201,1) 50%, rgba(242,204,201,1) 60%, rgba(235,222,240,1) 60%, rgba(235,222,240,1) 70%, rgba(239,196,167,1) 70%, rgba(239,196,167,1) 80%, rgba(190,228,228,1) 80%, rgba(190,228,228,1) 90%, rgba(242,204,201,1) 90%)',
        zIndex: -1,
      }}>
        {gradient}
      </View>
    )}
export default MyView;
